export const   Entry = () => {

  const [email,setEmail]=useState("")
  const [password,setPassword]=useState("")

  const handleOnchange=e=>{

     const {name,value}=e.target;

      switch(name){

        case "email":
          setEmail(value);
          break;
        case "password":
          setPassword(value);
          break;


      }

}






const handleOnsubmit=(e)=>{

   e.preventDefault();

   if(!email|| !password){

  return alert("fill up all the form")

   }else{
   console.log(email,password)
   }
};




